import React from 'react';

class Checkbox extends React.Component {

    constructor(props){
        super(props)

        this.state = {
            box: false
        }
    }

    render() {
        return (
        <div>
            <input type="checkbox" name="box" 
            checked={this.state.box} 
            onChange={this.onCheck}/>
        </div>
        )}
}

export default Checkbox;
